description:
Category Feature, Horror, Zombies

 Director Tommy Pistol
 Starring Bonnie Rotten, Mark Wood, John Strong, Annie Cruz, Tommy Pistol, Asphyxia Noir, Phoenix Askani, Nikki Hearts

 The Best Head is Undead!

 Bonnie Rotten stars in her first leading adult role as a bounty hunter and one of the last few survivors left in the zombie apocalypse.

 After a pill was invented to cure the world's obesity dilemma, it turned everyone who's taken the pill into crazed, uncontrollable flesh eating psychos. Years passed and only a few men in the world are still clean and can generate pure semen.


